The  Layout  type is defined as  type Layout{T :Associative{Symbol,Any}}  : AbstractLayout
    fields::T
end  You can construct a layout using the same convenient keyword argument syntax
that we used for traces:  julia  l = Layout(;title= Penguins ,
                   xaxis_range=[0, 42.0], xaxis_title= fish ,
                   yaxis_title= Weight ,
                   xaxis_showgrid=true, yaxis_showgrid=true,
                   legend_y=1.15, legend_x=0.7)
layout with fields legend, margin, title, xaxis, and yaxis


julia  println(JSON.json(l, 2))
{
   yaxis : {
     title :  Weight ,
     showgrid : true
  },
   legend : {
     y : 1.15,
     x : 0.7
  },
   xaxis : {
     range : [
      0.0,
      42.0
    ],
     title :  fish ,
     showgrid : true
  },
   title :  Penguins ,
   margin : {
     r : 50,
     l : 50,
     b : 50,
     t : 60
  }
}

There is a special function named  attr  that allows you to apply the same
keyword magic we saw in the trace and layout functions, but to nested
attributes. Let's revisit the previous example, but use  attr  to build up our xaxis  and  legend :  julia  l2 = Layout(;title= Penguins ,
                    xaxis=attr(range=[0, 42.0], title= fish , showgrid=true),
                    yaxis_title= Weight , yaxis_showgrid=true,
                    legend=attr(x=0.7, y=1.15))
layout with fields legend, margin, title, xaxis, and yaxis


julia  println(JSON.json(l2, 2))
{
   yaxis : {
     title :  Weight ,
     showgrid : true
  },
   legend : {
     y : 1.15,
     x : 0.7
  },
   xaxis : {
     range : [
      0.0,
      42.0
    ],
     title :  fish ,
     showgrid : true
  },
   title :  Penguins ,
   margin : {
     r : 50,
     l : 50,
     b : 50,
     t : 60
  }
}  Notice we got the exact same output as before, but we didn't have to resort to
building the  Dict  by hand  or  prefixing multiple arguments with  xaxis_  or legend_ .

The best way to think about styles is that they will apply default values for
attributes, only if the attribute is not already defined. For example, suppose
we had the following style:  goofy = Style(global_trace=attr(marker_color= red ),
              trace=Dict(:scatter =  attr(mode= markers )))  two plots:  p1 = plot(scatter(y=1:3, mode= lines , marker_symbol= square ), style=goofy)
p2 = plot(scatter(y=1:3, marker_color= green ), style=goofy)  If we inspect the json from these two plots we see:  julia  print(json(p1, 2))
{
   layout : {
     margin : {
       r : 50,
       l : 50,
       b : 50,
       t : 60
    }
  },
   data : [
    {
       y : [
        1,
        2,
        3
      ],
       type :  scatter ,
       mode :  lines ,
       marker : {
         symbol :  square ,
         color :  red 
      }
    }
  ]
}

julia  print(json(p2, 2))
{
   layout : {
     margin : {
       r : 50,
       l : 50,
       b : 50,
       t : 60
    }
  },
   data : [
    {
       y : [
        1,
        2,
        3
      ],
       type :  scatter ,
       marker : {
         color :  green 
      },
       mode :  markers 
    }
  ]
}  Notice that on p1:   the  marker.color  attribute was set to red  marker.symbol  remained square  mode  was not changed from  lines  to  markers .   On the other hand, in  p2  we see that the   mode  was set to  markers  marker.color  was not changed from green to red   This happened because the scatter in p1 defined the  mode  attribute, but not marker_color  whereas the scatter in p2 defined  marker_color  but not  mode .
In both cases the attributes inside the  Style  became a default value for
fields that were not already set inside the trace.

